import React, { Component } from 'react';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch, faCloud, faCloudRain } from "@fortawesome/free-solid-svg-icons";
import "./LeftSide.css";
import city from "./city/cairotower.jpg";

class LeftSide extends Component {
    render() {
        return (
            <div className="left_side">
                <div className="container">
                    {/* Search Field -> Search for places */}
                    <div className="search_field">
                        <input type="search" placeholder="Search for places..."></input>
                        <div className="search_icon"><FontAwesomeIcon icon={faSearch}/></div>
                    </div>
                    {/* Search Field -> Search for places */}

                    {/* API Icon */}
                    <div className="API_icon">
                        <img src="https://picsum.photos/150" alt="placeholder"/>
                    </div>
                    {/* API Icon */}

                    {/* Current Weather */}
                    <div className="current_weather">
                        <h1 className="temp">{`${12}°C`}</h1>
                        <h5 className="day_time">Monday, <span>16:00</span></h5>
                        <hr></hr>
                    </div>
                    <div className="current_weather2">
                            <div className="cloud"> <FontAwesomeIcon icon={faCloud}/> <span>Mostly Cloudy</span></div>
                            <div className="rain"> <FontAwesomeIcon icon={faCloudRain}/> <span>{`Rain - ${30}%`}</span></div>
                            <div className="city">
                                <img src={city} alt="Cairo"/>
                            </div>
                        </div>
                    {/* Current Weather */}
                </div>
            </div>
        )
    }
}

export default LeftSide;
